import React from "react"
import './App.css';
import { setClickFunction } from './SnakeApp.js';


function activateLasers () {
	console.warn("DEBUG DEBUG activateLasers!!!!")
	setClickFunction();
}

function Snake(props) {
  return (
    <div className="container-fluid">
      <h1>Its Snake Bitch</h1>
      <div id="game-board"></div>

      <div id="start-snake">START TEST</div>
      <div className="row" >
	      <div id="homeInfo">
	        <button className="btn"
	        			  onClick={activateLasers}>
	        	Click Here
	        </button>
	      </div>
	    </div>

      <div className="row" id="snakeGame">
	      <p>score: <span id="score"></span></p>
	      <div id="gameSpace"></div>
	    </div>

    </div>
  )
}

export default Snake;
